const http = (a, b, c, d) => {
  fetch("http://localhost:5000/register", {
    method: "POST",
    crossDomain: true,
    headers: {
      "Content-Type": "application/json",
      Accept: "application/json",
      "Access-Control-Allow-Origin": "*",
    },
    body: JSON.stringify({
      fname: a,
      email: b,
      lname: c,
      password: d,
    }),
  })
    .then((res) => res.json())
    .then((data) => {
      console.log(data, "userRegister");
    });
};

export default http;
